import SearchForm from "./SearchForm";
import Card from "./Card";
import "./StartPage.css";

const DUMMY_LIST = [
  {
    title: "Yes",
    key: "0",
  }
];

const StartPage = () => {
  return (
    <div>
      <SearchForm />
      <ul>{DUMMY_LIST.map(movie => <Card title={movie.title}/> )}</ul>
    </div>
  );
};

export default StartPage;
